                      if (itm.toUpperCase().includes('BNI')) image = 'https://d16ffhbavct33g.cloudfront.net/img/bni.7cbd8e9a.svg';
                      if (itm.toUpperCase().includes('MANDIRI')) image = 'https://d16ffhbavct33g.cloudfront.net/img/mandiri.edc29916.svg';
                      if (itm.toUpperCase().includes('PERMATA')) image = permataPNG;
                      if (itm.toUpperCase().includes('BRI')) image = 'https://d16ffhbavct33g.cloudfront.net/img/bri.356cd19d.svg';

