  componentWillReceiveProps(nextProps) {

    if (nextProps.showSubdistricsData.length > 0) {
      this.setState({subdistrics: nextProps.showSubdistricsData})
    }

    let data = []
    if (nextProps.showShipmentCostData != undefined && nextProps.showShipmentCostData.length > 0 && parseInt(this.props.showSummaryOrderCartData.totalWeight) > 0) {
      //console.log('---->ARTAKA showLogisticsData2: ', nextProps.showShipmentCostData)

      let shipmentCostData = JSON.parse(nextProps.showShipmentCostData)
      //console.warn('---ARTAKA1 showShipmentCostData: ', shipmentCostData)
      if (shipmentCostData.rajaongkir.status.code == 200) {
        //console.warn('---ARTAKA2 showShipmentCostData: ', shipmentCostData.rajaongkir.results)
        let image = ''
        shipmentCostData.rajaongkir.results.forEach((item, i) => {

          if (item.code == 'sicepat') image = 'https://d16ffhbavct33g.cloudfront.net/img/sicepat.8de9681f.svg'
          if (item.code == 'jne') image = 'https://d16ffhbavct33g.cloudfront.net/img/jne.54daafc1.svg'
          if (item.code == 'tiki') image = 'https://i.pinimg.com/originals/71/db/8a/71db8af0b716777a6277f9c771fc6085.png'

          if (item.code == 'J&T') image = 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQJNQYMu06xZCcYgIew6lT6ZoISbISMM6gm5a-eT4w&usqp=CAU'
          if (item.code == 'pahala') image = pahalaexpress
          if (item.code == 'wahana') image = 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQ6sAcuIUz8yGy-_xtvFAzJ6czxvxQy6NE6kaPLVaQ&usqp=CAU'
          if (item.code == 'ninja') image = 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQEAE15KlH7RVvBF1utEiWI5HOz1VNy8UC4hhNeCbbf46koqEAJ&usqp=CAU' //'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR9o7yjnzVYHSq0zM70GCx43evv8rJmvpKNC7iufX_lQHPANZNP&usqp=CAU'    
          if (item.code == 'lion') image = 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSPvWw5c1B9deFpx5QrVBtxoaCFdFi0iGkKC92AbmU&usqp=CAU'
          if (item.code == 'pos') image = 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSV37FSS-_IJHihdRAlpfYeDFd7rCIt0WBN6WKZ0Lg5fx8vG23i&usqp=CAU'

          item.costs.forEach((x, j) => {
            let kurir = {
              kurir: item.name,
              service: x.service + ' ' + (x.cost[0].etd != undefined ? x.cost[0].etd + ' hari,' : '') + ' Rp ' + formatNumber(x.cost[0].value),
              ongkir: x.cost[0].value,
              image: image
            }
            data.push(kurir)
          });

        });
        
      }
      //console.log('ARTAKA deliveryOptionRajaOngkir: ', data)
      this.setState({deliveryOptionRajaOngkir: data})
      
    

      //merge delivery option
      let datax = this.state.deliveryOptionMandiri.filter(item => item.kurir == 'Pembeli Pick-Up' || item.kurir == 'Diantar Oleh Penjual' || item.kurir == 'Ojek Online')

      if (data.length > 0) {
        this.state.deliveryOptionMandiri.forEach(item => {
          let temp = data.filter(x => x.kurir.includes(item.kurir))
          if (temp.length > 0) {
            datax = datax.concat(temp)
          }
        })

        setTimeout(() =>
          this.setState({ loaderVisible: false })
        ,1500)
      }

      this.setState({deliveryOption: datax})
      //console.log('ARTAKA deliveryOption: ', datax)
    }
  }

  searchSubdistric(event) {
    let searchText = event.target.value
    this.setState({subdistricsName: searchText})
    if (searchText.length >= 3) {
      let tmp = this.state.subdistrics.filter(item => item.subdistrict_name.concat(item.city).toUpperCase().includes(searchText.toUpperCase()))
      this.setState({filteredsubdistrics: tmp})
    }
  }

  saveCustomerInfo() {
    let customer = {
      nama_penerima: this.state.nama_penerima,
      handphone: this.state.handphone,
      email: this.state.email,
      alamat: this.state.alamat,
      kecamatan: this.state.kecamatan,
      kodepos: this.state.kodepos,
      subdistrics_info: this.state.subdistrics_info,
      fcm_web_token: this.state.fcm_web_token,
    }
    localStorage.setItem('CUSTOMER', JSON.stringify(customer))
    if (parseInt(this.props.showSummaryOrderCartData.totalWeight) > 0) {
      this.props.showShipmentCost({'origin': this.state.profile[0].address.split('|')[3], 'originType': 'subdistrict', 'destination': customer.subdistrics_info.subdistrict_id, 'destinationType': 'subdistrict', 'weight': parseInt(this.props.showSummaryOrderCartData.totalWeight), 'courier': 'jne:tiki:sicepat:wahana:jnt:pahala:ninja:lion:pos'})
    }
    //console.log('ARTAKA----: ', customer)
  }

