   getButtons(info, id) {
     if (!this.state.locationEditing && info === 'EDIT') {
       return (
         <button className="marB20"
           onClick={() => {
             this.setState({ locationEditing: true });
           }}>
           Ubah
         </button>
       );

     } else if (!this.state.contactEditing && info === 'CHOOSE') {
       return (
         <button className="marB20"
           onClick={() => {
             if (id == 1) {
               this.setState({ deliveryOptionActive: true });
             } else {
               this.setState({ paymentOptionActive: true });
             }
           }}>
           Pilih
         </button>
       );

     } else {
       let buttons;
       switch (info) {
         case 'EDIT': //Simpan, Batal
           buttons = ([
             <button className="marB20"
               key="lSave"
               onClick={() => {
                 this.setState({ locationEditing: false });
                 let customer = {
                   nama_penerima: this.state.nama_penerima,
                   handphone: this.state.handphone,
                   email: this.state.email,
                   alamat: this.state.alamat,
                   kecamatan: this.state.kecamatan,
                   kodepos: this.state.kodepos,
                   subdistrics_info: this.state.subdistrics_info,
                   fcm_web_token: this.state.fcm_web_token,
                 }
                 localStorage.setItem('CUSTOMER', JSON.stringify(customer))
                 if (parseInt(this.props.showSummaryOrderCartData.totalWeight) > 0) {
                  this.props.showShipmentCost({'origin': this.state.profile[0].address.split('|')[3], 'originType': 'subdistrict', 'destination': customer.subdistrics_info.subdistrict_id, 'destinationType': 'subdistrict', 'weight': parseInt(this.props.showSummaryOrderCartData.totalWeight), 'courier': 'jne:tiki:sicepat:wahana:jnt:pahala:ninja:lion:pos'})
                 }
                 //console.log('ARTAKA----: ', customer)
               }}>
               &nbsp;
             </button>,
             <button className="marB20 cancelBtn"
               key="lCancel"
               onClick={() => {
                 this.setState({ locationEditing: false });
               }}>
              &nbsp;
             </button>
           ]);

           break;
         case 'CHOOSE': //Simpan, Batal
           buttons = ([
             <button className="marB20"
               key="cSave"
               onClick={() => {
                 this.setState({ contactEditing: false });
               }}>
               &nbsp;
             </button>,
             <button className="marB20 cancelBtn"
               key="cCancel"
               onClick={() => {
                 this.setState({ contactEditing: false });
               }}>
              &nbsp;
             </button>
           ]);
           break;
       }
       return buttons;
     }
   }

   // Open Modal
   openModal(product) {
     this.setState({
       modalActive: true
     });
   }


   // Close Modal
   closeModal(item, source) {
     //console.log('---->close modal ARTAKA: ', item, source)
     this.setState({
       deliveryOptionActive: false,
       paymentOptionActive: false,
       cityOptionActive: false,
     });

     if (source == 'Pilih Metode Pengiriman' && item != 'close') {
       this.setState({ekspedisi: item.kurir, service: item.service, ongkir: item.ongkir})
       this.setState({paymentOptionFiltered: this.state.paymentOption})
       if (item.kurir == 'Diantar Oleh Penjual' || item.kurir == 'Pembeli Pick-Up') {

       } else {
         let data = this.state.paymentOption.filter(item => (item.kurir.includes('Virtual Account') || item.kurir.includes('Transfer')))
         this.setState({paymentOptionFiltered: data})         
       }
     }
     if (source == 'Pilih Metode Pembayaran' && item != 'close') {

      if ((this.state.ekspedisi == 'Ojek Online') && (item.kurir.includes('Virtual'))) {
        this.showToast('warning', 'Pembayaran Virtual Account belum bisa dengan pengiriman Ojek Online')
      } else {
        this.setState({metode_bayar: item.kurir})
        if (item.kurir.includes('Transfer')) {
          //console.log('---->ARTAKA: ', item)
          this.setState({bank_account: item.ongkir, bank_holder_name: item.service})
        }
      }
     }
   }

   closeSearchSubdistricsModal(item, source) {
     //console.log('closeSearchSubdistricsModal ARTAKA: ', item, source, this.state.profile[0].address)
     if (item != 'close') {
        this.setState({
          kecamatan: item.subdistrict_name + ', ' + item.city + ', ' + item.province,
          kodepos: item.postal_code,
          subdistrics_info: item,
        });
        //console.log('ARTAKA showShipmentCost')
        if (parseInt(this.props.showSummaryOrderCartData.totalWeight) > 0) {
          this.setState({loaderVisible: true})
          this.props.showShipmentCost({'origin': this.state.profile[0].address.split('|')[3], 'originType': 'subdistrict', 'destination': item.subdistrict_id, 'destinationType': 'subdistrict', 'weight': parseInt(this.props.showSummaryOrderCartData.totalWeight), 'courier': 'jne:tiki:sicepat:wahana:jnt:pahala:ninja:lion:pos'})
        }
     }
     this.setState({cityOptionActive: false})
   }

   showToast(level, message) {
     this.setState({showToast: true, levelToast: level, messageToast: message}, () => {
      setTimeout(() =>
        this.setState({ showToast: false })
        ,1500)
     })
   }

